import React from "react";
import "./about.css";

const About = () => {
  return (
    <div className="whatmedical section__margin" id="whatmed">
      <div className="whatmedical-service">
        <Service
          title="Where are we located?"
          text="Mission Medical Clinic is ideally situated at 2303 4th Street SW, Calgary, AB T2S 2S7. Our prime location at the intersection of 23rd Avenue SW and 4th Street SW ensures convenient access for our patients."
        />
      </div>
      <div className="whatmedical-heading">
        <h1>Give us a call!</h1>
        <p>(403)-229-1700</p>
      </div>
      <div className="whatmedical-container">
        <Service title="What are our hours?" text="We offer a variety..." />
      </div>
    </div>
  );
};

export default About;
